import React from 'react';
import AppLayout from '../components/AppLayout';
import MainCarousel from '../components/MainCarousel';
import MoviePoster from '../components/MoviePoster';

const Home = () => {
  const poster = [1, 2, 3];

  return (
    <>
      <AppLayout>
        <MainCarousel />
        <hr />
        <div>OO별 추천</div>
        {poster.map((a, i) => {
          return <MoviePoster i={i} />;
        })}
        <hr />
        <div>OO별 추천</div>
        <hr />
        <div>OO별 추천</div>
      </AppLayout>
    </>
  );
};

export default Home;
